const id = 'more_vertical_28';
const content = '<symbol fill="none" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 28 28" id="more_vertical_28"><path d="M16.25 7a2.25 2.25 0 11-4.5 0 2.25 2.25 0 014.5 0zm0 7a2.25 2.25 0 11-4.5 0 2.25 2.25 0 014.5 0zm0 7a2.25 2.25 0 11-4.5 0 2.25 2.25 0 014.5 0z" fill="currentColor" /></symbol>';

let isMounted = false;
function mountIcon() {
  if (!isMounted) {
    addSpriteSymbol(new BrowserSymbol({
      id: id,
      viewBox: viewBox,
      content: content,
    }));

    isMounted = true;
  }
}

export interface Icon28MoreVerticalProps extends HTMLAttributes<HTMLDivElement> {
